import {} from "@mui/mate";

function App() {
  return (
    <div className="App">
      <h1>Fetch</h1>
      <p>we won't stop trying to make fetch happen!</p>
      <Button variant="text">Text</Button>
      <Button variant="contained">Contained</Button>
      <Button variant="outlined">Outlined</Button>
    </div>
  );
}

export default App;
